import{_ as r,c as b,o as t,a as e}from"./app.af7f7d8f.js";const l='{"title":"\u7D10\u7D04\u7368\u767D","description":"","frontmatter":{},"relativePath":"Quotation/newYork.md","lastUpdated":1639876241654}',a={},p=e('<h1 id="\u7D10\u7D04\u7368\u767D" tabindex="-1">\u7D10\u7D04\u7368\u767D <a class="header-anchor" href="#\u7D10\u7D04\u7368\u767D" aria-hidden="true">#</a></h1><p>1986\u5E74\u521D\uFF0COZAKI\u53BB\u4E86\u7D10\u7D04\uFF0C\u4ED6\u5728\u7D10\u7D04\u7D93\u6B77\u4E86\u975E\u5E38\u6DD2\u6158\u548C\u5B64\u7368\u7684\u751F\u6D3B\u3002\u4EE5\u4E0B\u662FOZAKI\u5728\u7D10\u7D04\u7684\u7368\u767D\uFF0C\u662F\u4ED6\u81EA\u5DF1\u7528\u9304\u97F3\u6A5F\u9304\u4E0B\u4F86\u7684\u3002\u7531\u65BC\u539F\u6587\u611F\u89BA\u5C31\u50CF\u9189\u6F22\u5728\u8AAA\u8A71\u4E00\u6A23\uFF0C\u6240\u4EE5\u4E5F\u8A31\u6709\u5F88\u591A\u5730\u65B9\u8F03\u96E3\u660E\u767D\uFF0C\u800C\u6211\u4EA6\u76E1\u91CF\u5FE0\u65BC\u539F\u6587\u611F\u89BA\u53BB\u7FFB\u8B6F\uFF0C\u7FFB\u8B6F\u5F97\u4E0D\u597D\u4E4B\u8655\uFF0C\u656C\u8ACB\u898B\u8AD2\u3002</p><hr><p>\u6211\u9023\u61C9\u8A72\u8981\u53BB\u9B25\u722D\u7684\u6771\u897F\u4E5F\u5931\u53BB\u4E86\u554A<br> \u53EF\u662F\u554A\uFF0C\u537B\u8981\u8F9B\u82E6\u52DE\u5F79\u554A<br> \u771F\u7684\u6709\u5728\u8F9B\u82E6\u52DE\u5F79\u7684\u50A2\u4F19\u554A<br> \u81F3\u5C11\uFF0C\u6211\u4E5F\u60F3\u70BA\u4ED6\u5011\u800C\u5531\u6B4C\u5427<br> \u6C92\u4EBA\u660E\u767D\u6211\u5011\u7684\u8F9B\u82E6\u5462<br> \u5B8C\u5168\u6C92\u6709\u90A3\u7A2E\u7406\u89E3\u5427<br> \u751A\u9EBC\u4E0D\u5920\u8070\u660E\u7684\u4EBA\u624D\u6703\u4E0D\u70BA\u6211\u6B4C\u5531<br> \u6211\u4E0D\u660E\u767D\u554A<br> \u5982\u4ECA\uFF0C\u6240\u6709\u4EBA\u90FD\u5FEB\u8981\u5F97\u5230\u5E78\u798F\u554A<br> \u53EA\u6709\u6211\u5427\uFF0C\u4E00\u76F4\u60F3\u8457\u90A3\u7A2E\u7121\u804A\u7684\u4E8B\u800C\u5728\u7169\u60F1\u8457<br> \u60F3\u8981\u5531\u6B4C\u3001\u60F3\u8981\u505A\u9EDE\u751A\u9EBC<br> \u7B97\u4E86\u5427\uFF0C\u6211\u554A<br> \u4E26\u4E0D\u662F\u70BA\u4E86\u8CFA\u9322\u800C\u5DE5\u4F5C\u7684\u554A<br> \u771F\u7684\u4E0D\u662F\u554A<br> \u6240\u6709\u4EBA\u4E5F\u4E0D\u662F\u90A3\u6A23\u60F3\u7684\u55CE<br> \u6240\u4EE5\u554A\uFF0C\u793E\u6703\u554A\uFF0C\u5BE6\u5728\u5341\u5206\u6C92\u610F\u601D<br> \u8981\u5BDF\u89BA\u554A\uFF0C\u793E\u6703\u554A<br> \u771F\u662F\u554A\uFF0C\u5F88\u5947\u602A\u554A\uFF0C\u6211\u7ADF\u70BA\u90A3\u7A2E\u4E8B\u800C\u54ED\u6CE3\uFF0C\u771F\u5947\u602A\u554A</p><p>\u6240\u6709\u4EBA\u4E5F\u4E0D\u4E86\u89E3\u6211\u554A<br> \u6211\u5FEB\u8981\u652F\u6301\u4E0D\u4F4F\u4E86\u554A<br> \u5440\u5440\uFF0C\u6211\u597D\u5BB3\u6015\u554A</p><p>\u5514\uFF0C\u5C0D\u6211\u4F86\u8AAA\uFF0C\u6700\u80FD\u7387\u76F4\u5730\u8868\u9054\u81EA\u5DF1\u7684\u65B9\u6CD5\u5230\u5E95\u662F\u751A\u9EBC\u554A<br> \u6211\u7684\u8868\u73FE\u65B9\u6CD5\u2026\u2026\u53EA\u6709\u5531\u6B4C\u554A<br> \u771F\u7684\uFF0C\u53EA\u8981\u6D3B\u8457\uFF0C\u5C31\u8981\u5531\u6B4C\u554A<br> \u662F\u771F\u7684\uFF0C\u6211\u7684\u9838\u5B50\u88AB\u62B5\u4F4F\uFF0C\u662F\u5200\u554A\uFF0C\u662F\u771F\u7684<br> \u5C0D\u5427\uFF0C\u8AAA\u771F\u7684\uFF0C\u8981\u8AAA\u6211\u70BA\u4E86\u751A\u9EBC\u800C\u5531\u6B4C<br> \u662F\u70BA\u4E86\u6240\u6709\u4EBA\u80FD\u5F97\u5230\u5E78\u798F\u554A<br> \u53EF\u662F\u6211\u89BA\u5F97\u6240\u6709\u4EBA\u8FFD\u6C42\u7684\u5E78\u798F\u90FD\u5F88\u6C92\u610F\u601D</p><p>\u771F\u7684\u5F88\u611A\u8822\u3001\u5F88\u6C92\u610F\u601D\u554A<br> \u53EF\u662F\uFF0C\u53BB\u505A\u7684\u8A71\uFF0C\u4E5F\u5F88\u6709\u8DA3\u5473\u5427<br> \u4E0D\u904E\uFF0C\u8DDF\u6211\u6240\u77E5\u9053\u7684\u5FEB\u611F\u4E0D\u540C\u554A\uFF0C\u662F\u771F\u6B63\u7684\u5FEB\u611F\uFF0C\u6240\u4EE5<br> \u6211\u5FC3\u4E2D\u7684\u746A\u5229\u4E9E\u5DF2\u6B7B\u4E86\u55CE\uFF1F\u6211\u5275\u4F5C\u51FA\u4E86\u90A3\u7A2E\u66F2\u554A<br> \u6211\u4E00\u5B9A\u6703\u7E7C\u7E8C\u4FDD\u6301\u5C11\u5E74\u7684\u5FC3<br> \u662F\u70BA\u4E86\u4E4B\u5F8C\u7684\u4EBA\u800C\u53BB\u90A3\u6A23\u505A\u5427<br> \u4E0D\u8B8A\u5F97\u8070\u660E\u9EDE\u662F\u4E0D\u884C\u7684\u554A\uFF0C\u662F\u771F\u7684\u5462</p><p>\u4E0D\u904E\uFF0C\u60B2\u54C0\u7684\u771F\u6B63\u6A21\u6A23<br> \u4E26\u4E0D\u80FD\u5920\u4EE3\u66FF\u90A3\u6771\u897F<br> \u6211\u4E0D\u660E\u767D\u554A<br> \u53EF\u662F\u3001\u53EF\u662F<br> \u6211\u89BA\u5F97\uFF0C\u82E5\u80FD\u597D\u597D\u5B89\u6170\u3001\u597D\u597D\u5B89\u6170\u90A3\u500B\u7684\u8A71<br> \u90A3\u5C31\u597D\u4E86\u2026\u662F\u771F\u7684\u554A<br> \u6211\u771F\u7684\u89BA\u5F97\u90A3\u5C31\u597D\u4E86\u554A<br> \u50CF\u662F\u68EE\u7530\u5065\u4F5C\uFF0C\u4E5F\u6709\u9752\u6625\u7684\u5927\u53D4\u7684<br> \u96D6\u7136\u4E0D\u660E\u767D\uFF0C\u4F46\u4F60\u5DF2\u7D93<br> \u6211\u4E5F\u5DF2\u7D93\u611F\u5230\u53AD\u60E1\u4E86<br> \u6211\u6240\u64C1\u6709\u7684\u6771\u897F\u771F\u7684\u5F88\u6C92\u610F\u601D\u554A\u2026\u771F\u7684<br> \u6C92\u610F\u601D\u7684\u6771\u897F\u5BE6\u5728\u6709\u592A\u591A\u4E86\uFF0C\u771F\u7684\u4EE4\u4EBA\u4E0D\u5FEB<br> \u9019\u6642\u5019\uFF0C\u6211\u771F\u7684\u5728\u8003\u616E\u904E\u56DE\u666E\u901A\u7684\u751F\u6D3B<br> \u70BA\u975E\u5E38\u55AE\u7D14\u7684\u6771\u897F\u611F\u5230\u975E\u5E38\u958B\u5FC3<br> \u5230\u982D\u4F86\uFF0C\u6211\u5C31\u53EA\u6709\u97F3\u6A02<br> \u5230\u982D\u4F86\uFF0C\u53EA\u6709\u70BA\u81EA\u5DF1\u800C\u751F<br> \u90A3\u4E26\u4E0D\u662F\u7368\u81EA\u7169\u60F1\u5C31\u6703\u660E\u767D\u7684\u6771\u897F\u2026\u771F\u7684\u554A<br> \u53EA\u8981\u6211\u9084\u6D3B\u8457<br> \u6211\u5C31\u6709\u7A31\u70BA\u8CAC\u4EFB\u7684\u6771\u897F\u554A<br> \u4E2D\u9014\u9000\u51FA\u592A\u96E3\u770B\u4E86\u554A\uFF01\u90A3\u662F\u6700\u96E3\u770B\u7684<br> \u6211\u554A\uFF0C\u771F\u7684\u4E0D\u64C5\u8FAD\u4EE4<br> \u771F\u7684\u2026\u6211\u2026\u4E0D\u64C5\u8FAD\u4EE4<br> \u6211\u4E0D\u64C5\u8FAD\u4EE4\u554A\u2026\u771F\u7684\u554A<br> \u4E0D\u64C5\u8FAD\u4EE4\u7684\u50A2\u4F19\u554A\uFF0C\u6B63\u5728\u62DA\u547D\u52AA\u529B\u4F5C\u8A5E\u5427</p><p>\u6211\u6C92\u6709\u982D\u8166\u5427<br> \u4E5F\u8A31\u6211\u771F\u7684\u6C92\u6709\u982D\u8166\u554A<br> \u53EF\u662F\uFF0C\u6211\u5FC5\u9808\u4E0D\u65B7\u601D\u8003<br> \u601D\u8003\u5E78\u798F\u5176\u5BE6\u662F\u600E\u9EBC\u56DE\u4E8B<br> \u5927\u6982\uFF0C\u9664\u4E86\u62DA\u547D\u53BB\u751F\u5B58\u4EE5\u5916<br> \u7121\u6CD5\u611F\u53D7\u5230\u5E78\u798F\u5427<br> \u62DA\u547D\u53BB\u52AA\u529B\uFF0C\u5C31\u662F\u90A3\u6A23<br> \u4F60\u88AB\u7A31\u70BA\u65B0\u4EBA\u554A\uFF0C\u4F60\u60F3\u5531\u51FA\u8272\u7684\u6B4C\u554A<br> \u6211\u4E5F\u60F3\u5531\u51FA\u8272\u7684\u6B4C\u554A<br> Punk\u2026\u5176\u5BE6\u6211\u6240\u505A\u7684<br> \u5C31\u662FPunk<br> \u5FC5\u9808\u8981\u60F3\u8FA6\u6CD5\u554A\uFF01\u6709\u4EBA\u5C0D\u6211\u8AAA\u2026\u90A3\u500B\u624D\u80FD<br> \u4F60\u6C92\u6709\uFF0C\u90A3\u6A23\u5C0D\u6211\u8AAA\u7684\u662F\u8AB0\u554A<br> \u6211\u70BA\u4E86\u751A\u9EBC\u800C\u5728\u82E6\u60F1\u554A<br> \u6C92\u6709\u4F60\u90A3\u7A2E\u624D\u80FD\u7684\u8A71<br> \u6C92\u6709\u624D\u80FD\u7684\u8A71\uFF0C\u90A3\u53C8\u600E\u6A23\u554A<br> \u662F\u6211\u60F3\u504F\u4E86\uFF0C\u662F\u5427<br> \u53EA\u6709\u751F\u5B58\u554A<br> \u9664\u4E86\u751F\u5B58\uFF0C\u76E1\u60C5\u5531\u6B4C<br> \u5C31\u662F\u751F\u5B58</p><p>\u96A8\u8457Rock<br> \u8D8A\u8AAA\u5F97\u591A<br> \u8D8A\u8981\u62DA\u547D\u53BB\u6D3B<br> \u62DA\u547D\u53BB\u6D3B<br> \u62DA\u547D<br> \u53BB\u6D3B\u3001\u53BB\u6D3B<br> \u53BB\u6D3B\u3001\u53BB\u6D3B\u2026\u2026</p><p>\u6240\u8B02\u751F\u5B58\u5C31\u662F\u53D6\u52DD\u3002\u771F\u7684\u5F88\u96E3\u770B<br> \u6240\u8B02\u751F\u5B58\u5C31\u662F\u53D6\u52DD\u554A\uFF01\u6240\u8B02\u751F\u5B58<br> \u6C92\u6709\u4EBA\u80FD\u5920\u4E92\u611B\u554A\uFF01\u751A\u9EBC\u611B\uFF0C\u7D66\u6211\u5403\u5C4E\u53BB\u5427<br> \u4F46\u662F\u554A\uFF0C\u5728\u5FC3\u4E2D\u554A\uFF0C\u5979\u4F9D\u7136\u6D3B\u8457\u554A<br> \u5728\u73FE\u5BE6\u4E2D\uFF0C\u6211\u7684\u746A\u5229\u4E9E\u5DF2\u7D93\u6B7B\u6389\u4E86<br> \u53EF\u662F\uFF0C\u5728\u6211\u5FC3\u4E2D\u5979\u4F9D\u7136\u6D3B\u8457\u554A<br> \u5728\u6211\u5FC3\u4E2D\uFF0C\u6C38\u9060\u7684\u611B\u5DF2\u6B7B\u6389\u4E86<br> \u8166\u6D77\u6D6E\u73FE\u8D77\u4ED6\u7684\u6A23\u5B50<br> \u771F\u7121\u804A\uFF0C\u53C8\u8981\u4F86\u5230\u9019\u88E1<br> \u62DA\u547D\u53BB\u6D3B</p>',11),o=[p];function _(n,s,c,d,i,f){return t(),b("div",null,o)}var u=r(a,[["render",_]]);export{l as __pageData,u as default};
